export default class Nav extends React.Component {
    render(){
        return(
            <nav>
                <div>
                    nav
                </div>
                <style jsx>
                    {`
                    nav {
                        width: 100%;
                        background: #fff;
                    }
                    `}
                </style>
            </nav>
        )
    }
}
